using System;
using System.Collections;
using System.Collections.Generic;
using System.Reflection;

using UnityEngine;

using ITEM_NET;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;

public class ItemNetExample : MonoBehaviour
{
    ItemNet itemNet;

    public string privateKey = "1897fcb99a60b6470f5fe5707c94d61f08a5cb2c22ffa267bc782f30615caab6";
    public string publicKey = "0c29dbc9cea83f646f2445f5f863464c0273f207109afa4042e65348dbb90813";
    public string address = "0x6f42573903497d820b8d896f46077a9352ae4aed7a6e02";
    public string nftuuid = "0x1af28279110af2f143ad73d5d99634af1ffaa5ae8e81";

    class ExampleListNFTStructure
    {
        public string type;
        public string from;
        public int page;
        public int count;
        public int sort;
    }
    public int page = 1;
    public int count = 1;
    public int sort = -1;

    class ExampleCreateNFTStructure
    {
        public string type;
        public string @class;
        public string name;
        public string thumbnail;
        public Dictionary<string, string> metadata;
        public long timestamp;
    }
    public string @nftClass = "MapleStory";
    public string nftName = "OrangeMush";
    public string nftThumbnail = "";
    public string nftDescription = "cute orange mush";
    public string nftImage = "";
    Dictionary<string, string> nftMetadata = new Dictionary<string, string>();

    public LogManager logManager;

    void Start()
    {
        itemNet = new ItemNet();

        nftMetadata.Add("description", nftDescription);
        nftMetadata.Add("image", nftImage);
    }

    public void NewAccount()
    {
        string privateKey = SASEULEnc.MakePrivateKey();
        string publicKey = SASEULEnc.MakePublicKey(privateKey);
        string address = SASEULEnc.MakeAddress(publicKey);

        Debug.Log("privateKey: " + privateKey);
        Debug.Log("publicKey: " + publicKey);
        Debug.Log("address: " + address);
    }

    public void Example_SendRequest()
    {
        ExampleListNFTStructure requestData = new ExampleListNFTStructure();
        requestData.type = "ListNFT";
        requestData.from = address;
        requestData.page = page;
        requestData.count = count;
        requestData.sort = sort;

        Debug.Log("Loading...");
        itemNet.SendRequest.Call(JsonConvert.SerializeObject(requestData)).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_SendTransaction()
    {
        ExampleCreateNFTStructure transactionData = new ExampleCreateNFTStructure();
        transactionData.type = "CreateNFT";
        transactionData.@class = @nftClass;
        transactionData.name = nftName;
        transactionData.thumbnail = nftThumbnail;
        transactionData.metadata = nftMetadata;
        transactionData.timestamp = DateTimeOffset.Now.ToUnixTimeMilliseconds() * 1000;

        Debug.Log("Loading...");
        itemNet.SendTransaction.Call(privateKey, JsonConvert.SerializeObject(transactionData)).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_SendRawTransaction()
    {
        ExampleCreateNFTStructure transactionData = new ExampleCreateNFTStructure();
        transactionData.type = "CreateNFT";
        transactionData.@class = nftClass;
        transactionData.name = nftName;
        transactionData.thumbnail = nftThumbnail;
        transactionData.metadata = nftMetadata;
        transactionData.timestamp = DateTimeOffset.Now.ToUnixTimeMilliseconds() * 1000;

        string transaction = JsonConvert.SerializeObject(transactionData);
        string thash = SASEULEnc.THash(transaction);
        string signature = SASEULEnc.MakeSignature(thash, privateKey);

        Debug.Log("Loading...");
        itemNet.SendRawTransaction.Call(transaction, thash, publicKey, signature).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_ListNFT()
    {
        Debug.Log("Loading...");
        itemNet.ListNFT.Call(address, page, count, sort).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_GetNFT()
    {
        Debug.Log("Loading...");
        itemNet.GetNFT.Call(nftuuid).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_GetNFTCBalance()
    {
        Debug.Log("Loading...");
        itemNet.GetNFTCBalance.Call(address).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
            if (task.Result.Item2)
            {
                JObject a = JObject.Parse(task.Result.Item1);
                string text = "NFTC: " + a["data"]["real_balance"].ToString();
                logManager.BalanceLog(text);
            }
        });
    }

    public void Example_NFTCount()
    {
        Debug.Log("Loading...");
        itemNet.NFTCount.Call().ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_FaucetNFTC()
    {
        Debug.Log("Loading...");
        itemNet.FaucetNFTC.Call(privateKey).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_CreateNFT()
    {
        Debug.Log("Loading...");
        itemNet.CreateNFT.Call(privateKey, nftClass, nftName, nftThumbnail, nftMetadata).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }

    public void Example_CreateNFTC()
    {
        Debug.Log("Loading...");
        itemNet.CreateNFTC.Call(privateKey).ContinueWith(task => {
            logManager.SaseulResultLog(MethodBase.GetCurrentMethod().Name, task.Result.Item1, task.Result.Item2);
        });
    }
}